import Toolbar from "./components/Toolbar/Toolbar";
import "./App.css";

function App() {
  return (
    <Provider store={store}>
      <div className="App">
        <Toolbar />
        <div className="container-card">
          <Card />
        </div>
      </div>
    </Provider>
  );
}

export default App;
